
import { useState } from 'react';
import './App.css';

function App() {

    const [image, setImage] = useState("");

    const convert2base64 = e => {
        const file = e.target.files[0];

        const reader = new FileReader();

        reader.onloadend = () => {
            setImage(reader.result.toString());
            console.log(reader.result.toString())
        }

        reader.readAsDataURL(file);
    }
    return (
        <div className="App">
            {image ?
                <img src={image} style={{ width: "100px", height: "70px" }} alt="" />
                :
                <div>
                    <img src={"data:image/jpeg;base64"+""} style={{ width: "100px", height: "70px" }} alt="" />
                    <input type="file" onChange={(e) => convert2base64(e)} multiple/>
                </div>
            }
        </div>
    );
}

export default App;
